import React, { useState } from 'react';
import { Box, Container, Typography, Grid, Paper, Button, Stack, Collapse } from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';

const projects = [
  {
    title: 'Conv-AI Medical Chatbot',
    description: `A conversational AI chat-bot aiming to provide diagnoses for less priviledged society developed by Finetuning LLM's such as Llama, GPT.`,
    technologies: ['Python', 'Llama', 'GPT', 'Docker', 'PostgreSQL'],
    github: 'https://github.com/hruday-tej/conv-ai-medical-chatbot',
  },
  {
    title: 'Clinical Text Summarizer',
    description: 'A Large Language Model Fine-tuned to perform the task of Text Summarization of clinical history of patients, contrasted by the efficiencies of LSTM and BERT.',
    technologies: ['Python', 'LSTM', 'BERT', 'NLP', 'PyTorch'],
    github: 'https://github.com/hruday-tej/clinical-text-summarizer',
  },
  {
    title: 'Single Image Super Resolution',
    description: 'A GAN Model developed to enhance the quality of degraded images by an upscaling factor of 4, contrasted by the performance of CNN and image interpolation.',
    technologies: ['Python', 'GAN', 'CNN', 'Image Processing', 'TensorFlow'],
    github: 'https://github.com/hruday-tej/single-image-super-resolution',
  },
];

const Projects = () => {
  const [expanded, setExpanded] = useState(Array(projects.length).fill(false));

  const handleExpandClick = (idx) => {
    setExpanded((prev) => prev.map((v, i) => (i === idx ? !v : v)));
  };

  return (
    <Box id="projects" sx={{ py: 10, bgcolor: 'background.default' }}>
      <Container maxWidth="lg">
        <Box sx={{ display: 'flex', justifyContent: 'center', mb: 2 }}>
          <Box>
            <Typography variant="body1" sx={{ color: '#555', fontWeight: 500, textAlign: 'center' }}>
              Browse My Recent
            </Typography>
            <Typography variant="h2" sx={{ fontWeight: 700, textAlign: 'center', fontSize: 36 }}>
              Projects
            </Typography>
          </Box>
        </Box>
        <Grid container spacing={4} justifyContent="center">
          {projects.map((project, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Paper
                sx={{
                  borderRadius: 6,
                  border: '2px solid #bfc8ce',
                  p: 4,
                  height: '100%',
                  background: '#fff',
                  boxShadow: 'none',
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                }}
              >
                <Typography variant="h5" sx={{ fontWeight: 700, mb: 2, textAlign: 'center', fontSize: 28 }}>
                  {project.title}
                </Typography>
                <Typography variant="body1" sx={{ color: '#222', mb: 3, textAlign: 'center', fontSize: 18 }}>
                  {project.description}
                </Typography>
                <Collapse in={expanded[index]}>
                  <Box sx={{ mb: 2 }}>
                    <Typography variant="subtitle1" sx={{ fontWeight: 600, mb: 1, textAlign: 'center' }}>
                      Technologies Used
                    </Typography>
                    <Stack direction="row" spacing={1} justifyContent="center" flexWrap="wrap">
                      {project.technologies.map((tech, i) => (
                        <Box
                          key={i}
                          sx={{
                            px: 2,
                            py: 1,
                            borderRadius: 999,
                            background: '#fafbfc',
                            color: '#222',
                            fontWeight: 500,
                            fontSize: 15,
                            border: '1px solid #e0e0e0',
                            transition: 'all 0.2s',
                            cursor: 'pointer',
                            '&:hover': {
                              background: '#222',
                              color: '#fff',
                              borderColor: '#222',
                            },
                            mb: 1,
                          }}
                        >
                          {tech}
                        </Box>
                      ))}
                    </Stack>
                  </Box>
                </Collapse>
                <Stack direction="row" spacing={2} sx={{ justifyContent: 'center', width: '100%' }}>
                  <Button
                    startIcon={<GitHubIcon />}
                    href={project.github}
                    target="_blank"
                    rel="noopener noreferrer"
                    sx={{
                      borderRadius: 999,
                      px: 3,
                      fontWeight: 600,
                      border: '2px solid #111',
                      color: '#111',
                      background: '#fff',
                      boxShadow: 'none',
                      '&:hover': { background: '#f5f5f5', borderColor: '#111' },
                    }}
                  >
                    Github
                  </Button>
                </Stack>
                <Button
                  size="small"
                  onClick={() => handleExpandClick(index)}
                  sx={{ mt: 2, textTransform: 'none', fontWeight: 600, color: '#1976d2', alignSelf: 'center' }}
                >
                  {expanded[index] ? 'See less' : 'See more'}
                </Button>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Projects;
